function seletTactics() {
  let tacticsPreset = document.getElementById("seletTactics").value;
  document.getElementById("playerDM").style.visibility = document.getElementById("selectDM").style.visibility = document.getElementById("playerAM").style.visibility = document.getElementById("selectAM").style.visibility = "visible";
  document.getElementById("playerCM2").style.visibility = document.getElementById("selectCM2").style.visibility = document.getElementById("playerSS").style.visibility = document.getElementById("selectSS").style.visibility = "hidden";

  if (tacticsPreset === "4-3-3") {
    document.getElementById("playerAM").style.visibility = document.getElementById("selectAM").style.visibility =   document.getElementById("playerSS").style.visibility = document.getElementById("selectSS").style.visibility = "hidden";
    document.getElementById("playerCM2").style.visibility =  document.getElementById("selectCM2").style.visibility = "visible";
  }
   else if (tacticsPreset === "4-2-4") {
    document.getElementById("playerAM").style.visibility =  document.getElementById("selectAM").style.visibility = document.getElementById("playerDM").style.visibility =  document.getElementById("selectDM").style.visibility = "hidden";
    document.getElementById("playerSS").style.visibility =  document.getElementById("selectSS").style.visibility =  document.getElementById("playerCM2").style.visibility = document.getElementById("selectCM2").style.visibility ="visible";
  }
}